var 
factorial = function( n ) {
    var Fn;
    if ( 0 > n ) 
    {
        Fn = 0;
    }
    else if ( 2 > n ) 
    {
        Fn = 1;
    }
    else if ( 4 > n ) 
    {
        Fn = n*(n-1);
    }
    else
    {
        // compute it directly
        // use logarithmic sums to avoid overflows etc..
        var logFn = 0;
        while ( n > 1 ) logFn += Math.log(n--);
        Fn = Math.floor(0.5+Math.exp(logFn));
    }
    return Fn;
}
// http://en.wikipedia.org/wiki/Binomial_coefficient
,binomial = function( n, k ) {
    var Cnk;
    k = Math.min(k, n - k); // take advantage of symmetry
    if ( 0 > k || 1 > n ) 
    {
        Cnk = 0;
    }
    else if ( 0 === k || 1 === n ) 
    {
        Cnk = 1;
    }
    else if ( 1 === k ) 
    {
        Cnk = n;
    }
    else
    {
        // compute it directly
        // use logarithmic sums to avoid overflows etc..
        var logCnk = 0, i;
        for (i=0; i<k; i++) logCnk += Math.log(n - i) - Math.log(k - i);
        Cnk = Math.floor(0.5+Math.exp(logCnk));
    }
    return Cnk;
}
,partitions = function partitions( n, k, m ) {
    // compute number of integer partitions of n
    // into exactly k parts
    // having m as max value
    // m + k-1 <= n <= k*m
    if ( m === n && 1 === k ) return 1;
    if ( m+k>n+1 || k*m<n ) return 0;
    var j, jmax=Math.min(m,n-m-k+2), jmin=Math.max(1,Math.ceil((n-m)/(k-1))), p = 0;
    for (j=jmin; j<=jmax; j++) p += partitions( n-m, k-1, j );
    return p;
}
,partitions_dynamic = function( n, k, m ) {
    if ( m === n && 1 === k ) return 1;
    if ( m+k>n+1 || k*m<n ) return 0;
    // dynamic programming
    var T = new Array(n), i1, i2, i3, j, jmin, jmax;
    for (i1=0; i1<n; i1++)
    {
        T[i1] = new Array(k);
        for (i2=0; i2<k; i2++)
        {
            T[i1][i2] = new Array(m);
            for (i3=0; i3<m; i3++)
            {
                T[i1][i2][i3] = (i3===i1 && 1===i2+1) ? 1 : 0;
            }
        }
    }
    for (i1=1; i1<=n; i1++)
    {
        for (i2=1; i2<=k; i2++)
        {
            for (i3=1; i3<=i1; i3++)
            {
                if ( i3+i2>i1+1 || i2*i3<i1 ) continue;
                jmin = Math.max(1,Math.ceil((i1-i3)/(i2-1)));
                jmax = Math.min(i3,i1-i3-i2+2); 
                for (j=jmin; j<=jmax; j++)
                {
                    T[i1-1][i2-1][i3-1] += T[i1-i3-1][i2-2][j-1];
                }
            }
        }
    }
    return T[n-1][k-1][m-1];
}
